import React from "react";

export default function Login({ isOpen, children, closeLogin }) {
  if (!isOpen) return null;

  return (
    <div className="overlay">
      <div className="overlay-content">
        <button className="btn btn-sm flex-end" onClick={closeLogin}>
          X
        </button>
        {children}
      </div>
    </div>
  );
}
